When does a deprecated field in a MongoDB document get deleted?<p>I use NodeJS, MongoDB, and Mongoose. I changed a field from a string to a string array. A month ago, I had:</p>
<pre class="lang-js prettyprint-override"><code>// Before.
const UserSchema = new Schema({
  ip: String
});
</code></pre>
<p>Since last week, I have:</p>
<pre><code>// After.
const UserSchema = new Schema({
  ips: [String]
});
</code></pre>
<p>Because of my daily scripts where I do save the field, now none of the documents have the field <code>ip</code>. I assume that when NodeJS loads a user object, it uses the latest schema; when it saves the object, it overwrites any previous document. So I expect that the previous field <code>ip</code> would not survive an update with <code>user.save()</code>.</p>
<p>Is that true? If NodeJS only loads a document and does not save it, would it retain the original <code>ip</code> field?</p>
<p><strong>Update</strong>: Following the comment suggested, I ended up with a document that contains both versions:</p>
<pre><code>&gt; db.users.find({ip: {$ne: null}}, {ip: 1, ips: 1}).pretty()
{ &quot;_id&quot; : ObjectId(&quot;5f065633404c3e4aaac69142&quot;), &quot;ip&quot; : &quot;::1&quot; }
{
    &quot;_id&quot; : ObjectId(&quot;5f30773f86a1993db449e1b3&quot;),
    &quot;ip&quot; : &quot;::1&quot;,
    &quot;ips&quot; : [
        &quot;::1&quot;
    ]
}
</code></pre>
<p>If it contains <code>ips</code>, then it has saved the object with the new schema. So I don't understand when the original field <code>ip</code> was overwritten.</p>

